import './App.css';
import Button from './components/ButtonComponents/Button';
import ButtonBox from './components/ButtonComponents/ButtonBox';
import Screen from './components/CalculatorComponents/Screen';
import Wrapper from './components/WrapperComponent/Wrapper';
import CalcProvider from './context/CalculatorContext';

const buttonValues = [
  ["C","+-","%","/"],
  [7,8,9,'*'],
  [4,5,6,'-'],
  [1,2,3,'+'],
  [0,'.','='],
]

function App() {
  return (
    <div className="App">
    <CalcProvider>
        <Wrapper>
          <Screen />
          <ButtonBox>
            {buttonValues.flat().map((btn, i) => (
              <Button value ={btn} key={i}/>
            ))}
          </ButtonBox>
          <p>Hello App</p>
        </Wrapper>
      </CalcProvider>
    </div>
  );
}

export default App;
